import React, { Fragment, useEffect } from 'react';
import Header from "./components/layout/Header";

import 'materialize-css/dist/css/materialize.min.css';
import M from 'materialize-css/dist/js/materialize.min.js';
import './App.css';

const App = () => {
  useEffect(() => {
    //Init Materialize JS
    M.AutoInit();
  });
  return (
    <Fragment>
      <Header />
    </Fragment>
  );
}

export default App;
